    // 控制请求节奏
    const delay = (ms) => new Promise(resolve => setTimeout(resolve, ms));

    // 核心请求函数
    async function claimAll(statusElement) {
        statusElement.textContent = '开始处理...';
        for (let i = 0; i < usernames.length; i++) {
            const username = usernames[i];
            try {
                const res = await fetch("https://addplus.org/api/trpc/users.claimPoints?batch=1", {
                    headers: {
                        "accept": "*/*",
                        "accept-language": "zh-CN,zh;q=0.9,en;q=0.8",
                        "content-type": "application/json",
                        "priority": "u=1, i",
                        "sec-ch-ua": "\"Not)A;Brand\";v=\"8\", \"Chromium\";v=\"138\", \"Google Chrome\";v=\"138\"",
                        "sec-ch-ua-mobile": "?0",
                        "sec-ch-ua-platform": "\"Windows\"",
                        "sec-fetch-dest": "empty",
                        "sec-fetch-mode": "cors",
                        "sec-fetch-site": "same-origin",
                        "trpc-accept": "application/jsonl",
                        "x-trpc-source": "nextjs-react"
                    },
                    referrer: `https://addplus.org/boost/${username}`,
                    body: JSON.stringify({
                        "0": {
                            "json": {
                                "username": username
                            }
                        }
                    }),
                    method: "POST",
                    mode: "cors",
                    credentials: "include"
                });

                const json = await res.json();
                statusElement.textContent += `\n✅ [${i + 1}/${usernames.length}] ${username} -> ${JSON.stringify(json)}`;
            } catch (e) {
                statusElement.textContent += `\n✅ [${i + 1}/${usernames.length}] ${username} `;
            }
            await delay(500); // 每 0.5 秒一个请求
        }
        statusElement.textContent += '\n🎉 全部触发完毕！';
    }

